import React from "react";
import ReactDOM from "react-dom";
import { add, sub, mult, div } from "./App";
import cricket from "./images/cricket.mp4";
import "./index.css";

ReactDOM.render(
  <>
    <h1 className="overlay"> Zamsofts</h1>
    <div>
      <video src={cricket} autoPlay loop muted />
    </div>
    <h1 className="overlay"> Zamsofts</h1>
  </>,
  document.getElementById("root")
);
